import s from './Components/StyleApp/app.module.css'
import React from "react";
import {BrowserRouter, Route} from 'react-router-dom';
import Profile from "./Components/Profile/Profile";
import Header from "./Components/Header/Header";
import Footer from "./Components/Footer/Footer";
import {withSuspense} from "./hoc/Suspense";


const About = React.lazy(() => import("./Components/About/About"))
const AllOrderContainer = React.lazy(() => import("./Components/Orders/AllOreder/AllOrderContainer"))
const SliderItemContainer = React.lazy(() => import("./Components/SliderItem/SliderItemContainers"))
const BuyContainer = React.lazy(() => import("./Components/Buy/BuyContainer"))
const Checkout = React.lazy(() => import("./Components/Checkout/Checkout"))


function App(props) {
    return (
        <BrowserRouter path="/profile">
            <div className={s.App}>
                <Header/>

                <Route path="/about" render={withSuspense(<About/>)}/>

                <Route path="/profile" render={() => <Profile/>}/>

                <Route path="/items/:id" render={withSuspense(<AllOrderContainer/> || <SliderItemContainer/>)}/>

                <Route path="/buy" render={withSuspense(<BuyContainer/>)}/>

                <Route path="/checkout" render={withSuspense(<Checkout/>)}/>


                <Footer/>
            </div>
        </BrowserRouter>

    );
}

export default App;
